import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Modal from "react-modal";
import { Auth0Provider } from '@auth0/auth0-react';

Modal.setAppElement("#root");

ReactDOM.render(
  <Auth0Provider>
  <App />
  </Auth0Provider>,
  document.getElementById("root")
);
